// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { AwTableCommandBarRenderFunction } from 'js/AwTableCommandBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwTableCommandBarService', () => import('js/AwTableCommandBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "AwTableCommandBarRenderFunction",
            "deps": "js/AwTableCommandBarService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "anchor": {
            "type": "object"
        },
        "context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwTableCommandBar",
    "_uniqueViewModelId": "AwTableCommandBar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, AwTableCommandBarRenderFunction, undefined, ctxImportObj );

export default Component;
